export const USER_ACTIONS = {
  loadUsers: "user/loadUsers",
  startLoading: "user/startLoading",
  successLoading: "user/successLoading",
  failLoading: "user/failLoading",
};

export const loadUsers = () => ({
  type: USER_ACTIONS.loadUsers
});

export const successLoading = (normalizedUser) => ({
  type: USER_ACTIONS.successLoading,
  payload: normalizedUser,
});

export const failLoading = () => ({
  type: USER_ACTIONS.failLoading,
});

export const startLoading = () => ({
  type: USER_ACTIONS.startLoading,
});
